import axios from 'axios';
let userValue = '';
let data = ':)';
//axios.defaults.baseURL = 'https://vpic.nhtsa.dot.gov/api/vehicles/DecodeVin/5UXWX7C5*BA?format=json&modelyear=2011';

const getIN = (event)=>{
    userValue = event.target.value;
    console.log(userValue);
}

const sub = (event)=>{
    axios.get('https://vpic.nhtsa.dot.gov/api/vehicles/DecodeVin/5UXWX7C5*BA?format=xml&modelyear=2011')
      .then(function(res) {console.log(res);})
      .catch(function(err) {console.error(err);})
    alert(data);
}
export {getIN, sub};
